-- First, I'll create the database named doughnuts
create database doughnuts;
-- Let's activate the new doughnuts dataset!
use doughnuts;
/*
 The "Products" table contains the following columns:
 - Product_ID - Primary key
 - Product_name
 - Category
 - Price (USD $)
 */
create table Products (
Product_ID int primary key auto_increment,
Product_name varchar(100) not null,
Category enum ('Glazed','Iced','Filled','Cake','Chocolate','Hot Drinks','Cold Drinks') not null,
Price decimal(5,2) not null);
-- Let's take a look at the Products table - before we insert our data
SELECT 
    *
FROM
    Products;
-- Now let's insert some data into Products table
-- Here's a glimp of the Products table - after we insert our data
SELECT DISTINCT
    *
FROM
    Products
ORDER BY Product_ID;
/* Now I'll create the "Stores" table - which include 357 Krispy Kreme stores (which 3 of them are permanently closed)
which are located throughout the USA
The "Stores" table contains the following columns:
- store_id - The primary key
- store_name - 
- store_address - 
- city - 
- state - 
*/
create table Stores (
store_id int auto_increment primary key,
store_name varchar(255) not null default 'Krispy Kreme',
store_address varchar(255),
city varchar(50),
state varchar(30));
-- Let's check our data at Stores table
SELECT 
    *
FROM
    stores;
/* Let's create another table - Customers
The "Customers" table contains the following columns:
- customer_id - The Primary key
- first_name - 
- last_name -
- gender - Customer's gender, an ENUM ("Male" or "Female")
- birthdate
- age
- city
- state
- email - 
- signup_date - 
- rewards_points - 
*/
create table Customers (
customer_id int auto_increment primary key,
first_name varchar(30),
last_name varchar(50),
gender enum ('Male','Female'),
birthdate date,
age int,
city varchar(50),
state varchar(30),
email varchar(60),
signup_date date,
rewards_points int,
store_id int,
 foreign key (store_id) references Stores (store_id));
-- Let's check our new Customers table
SELECT 
    *
FROM
    customers;
-- Now let's check our Customers table after we inserted some customers data
SELECT 
    *
FROM
    Customers;
SELECT DISTINCT
    first_name, gender
FROM
    Customers;
