-- Now I'll build the Orders table
create table orders (
    order_id int auto_increment primary key,
    customer_id int,
    first_name varchar(50),
    last_name varchar(50),
    gender enum('Male', 'Female'),
    preferred_store_id int,
    store_name varchar(100),
    store_address varchar(255),
    product_id int,
    product_name varchar(100),
    price decimal(5,2),
    quantity int,
    total_price decimal(7,2),
    order_date date,
    foreign key (customer_id) references customers(customer_id),
    foreign key (preferred_store_id) references stores(store_id),
    foreign key(product_id) references products(product_id)
);
use doughnuts;
-- Now let's check from our Customers table - who's the youngest and the oldest customer
select * from customers;
(SELECT 
    first_name, last_name, gender, MAX(age) AS max_age
FROM
    customers)
    union all
(SELECT 
    first_name, last_name, gender, MIN(age) AS min_age
FROM
    customers)
union all
(select
 first_name, last_name, gender, round(avg(age),2) as avg_age 
 from
 customers);
SELECT 
    *
FROM
    orders;
SELECT 
    first_name,
    last_name,
    gender,
    store_name,
    product_name,
    price,
    MAX(quantity) AS max_order
FROM
    orders;
-- Now let's add another column for Orders table which calculate total price by multiplying price with quantity
SELECT 
    *
FROM
    orders;
alter table orders
drop column total_price;
alter table orders
add column total_price decimal (10,2);
UPDATE orders 
SET 
    total_price = price * quantity;
    -- Let's check who made the biggest and the smallest order and where
(SELECT 
    order_id,
    customer_id,
    first_name,
    last_name,
    store_name,
    price,
    quantity,
    (price * quantity) AS total_price_calculated
FROM
    orders order by total_price_calculated desc limit 1)
    union all
(SELECT 
    order_id,
    customer_id,
    first_name,
    last_name,
    store_name,
    price,
    quantity,
    (price * quantity) AS total_price_calculated
FROM
    orders order by total_price_calculated asc limit 1);
